import logo from './logo.svg';
import './App.css';

function Board(){
  return(
    <div className='board'>
      <div className='boardLine'>
        <Square></Square>
        <Square></Square>
        <Square></Square>
        <Square></Square>
        <Square></Square>
        <Square></Square>
        <Square></Square>
      </div>
      <div className='boardLine'>
        <Square></Square>
        <Square></Square>
        <Square></Square>
        <Square></Square>
        <Square></Square>
        <Square></Square>
        <Square></Square>
      </div>
      <div className='boardLine'>
        <Square></Square>
        <Square></Square>
        <EmpoweredSquare></EmpoweredSquare>
        <EmpoweredSquare></EmpoweredSquare>
        <EmpoweredSquare></EmpoweredSquare>
        <Square></Square>
        <Square></Square>
      </div>
      <div className='boardLine'>
        <Square></Square>
        <Square></Square>
        <EmpoweredSquare></EmpoweredSquare>
        <CoreSquare></CoreSquare>
        <EmpoweredSquare></EmpoweredSquare>
        <Square></Square>
        <Square></Square>
      </div>
      <div className='boardLine'>
        <Square></Square>
        <Square></Square>
        <EmpoweredSquare></EmpoweredSquare>
        <EmpoweredSquare></EmpoweredSquare>
        <EmpoweredSquare></EmpoweredSquare>
        <Square></Square>
        <Square></Square>
      </div>
      <div className='boardLine'>
        <Square></Square>
        <Square></Square>
        <Square></Square>
        <Square></Square>
        <Square></Square>
        <Square></Square>
        <Square></Square>
      </div>
      <div className='boardLine'>
        <Square></Square>
        <Square></Square>
        <Square></Square>
        <Square></Square>
        <Square></Square>
        <Square></Square>
        <Square></Square>
      </div>
    </div>
  )
}

function Tokens(){

}

function Square(value, type){
  return(
    <button className="square"></button>
    );
}
function EmpoweredSquare(value, type){
  return(
    <button className="empoweredSquare"></button>
    );
}
function CoreSquare(value, type){
  return(
    <button className="coreSquare"></button>
    );
}

function Token(){
  return(
    <button className="token"></button>
    );
}
function Game() {
  return(
    <Board></Board>
  )
}

export default Game;
